    {
      print ""include \""/Users/franck/development/evm-dis/src/dafny/AbstractSemantics/AbstractSemantics.dfy\"""", ""\n\n"";
      print ""module "" + name + "" {"", ""\n\n"";
      print ""import opened AbstractSemantics"", ""\n"";
      print ""import opened AbstractState"", ""\n"";
