  function DecToChar(n: nat): char
    requires 0 <= n < 10
    ensures '0' <= DecToChar(n) <= '9'
    decreases n
  {
    match n
    case 0 =>
      '0'
    case 1 =>
      '1'
    case 2 =>
      '2'
    case 3 =>
      '3'
    case 4 =>
      '4'
    case 5 =>
      '5'
    case 6 =>
      '6'
    case 7 =>
      '7'
    case 8 =>
      '8'
    case 9 =>
      '9'
  }

  function DecToString(n: nat): string
    decreases n
  {
    if n < 10 then
      [DecToChar(n)]
    else
      DecToString(n / 10) + [DecToChar(n % 10)]
  }

