    }

    static function MaxNat(a: nat, b: nat): nat
      decreases a, b
    {
      if a > b then
        a
      else
        b
    }

    static function MaxNatSeq(xs: seq<nat>): (r: nat)
      ensures forall k: int {:trigger xs[k]} :: 0 <= k < |xs| ==> xs[k] <= r
      ensures forall k: int {:trigger k in xs} :: k in xs ==> k <= r
      decreases xs
