      SysOp(""CREATE2"", CREATE2, 1, 4, 1, 4)
    case STATICCALL =>
      SysOp(""STATICCALL"", STATICCALL, 1, 6, 1, 6)
    case REVERT =>
      SysOp(""REVERT"", REVERT, 0, 2, 0, 2)
    case SELFDESTRUCT =>
      SysOp(""SELFDESTRUCT"", SELFDESTRUCT, 0, 1, 0, 1)
    case _ /* _v0 */ =>
      SysOp(""INVALID"", INVALID, 0, 0, 0, 0)
  }

